import Card from "../UI/Card";

const UsersList = (props) => {
    return (
        <Card>
            {console.log('In List.js', props.data)}

            <ul>
                {props.data.map((user) => (
                    <li>{user.username} ({user.age} years old)</li> 
                ))}
            </ul>
        </Card>
    );
}

export default UsersList;
